column8:
車種専用だからCAN-BUS通信によって、本格ハイクォリテーなカーセキュリティを簡単配線で取付可能<BR><BR>
<B>適合車種情報</B><BR>

<P>商品機能紹介</P>
<P><FONT color="#cc00cc" size="4"><B>◆純正キーレス・スマートキー連動</B></FONT><BR>
車両純正のキーレスのロック/アンロック操作でセキュリティはON/OFFします。車両のCUN-BUS信号と同期します。</P>
<P><FONT color="#cc00cc" size="4"><B>◆ハイクオリティサイレン搭載</B></FONT><BR>
新保安基準対応耐熱（125度）、ＢＥＥＰサイレン。125dBの大音量で威嚇します。</P>
<P><FONT color="#cc00cc" size="4"><B>◆アクティブIR（赤外線）型　2ステージショックセンサー</B></FONT><BR>
誤作動が無く非常に高感度なセンサーを搭載しています。軽い衝撃で警告動作、強い衝撃で本警報を行います。</P>
<P><FONT color="#cc00cc" size="4"><B>◆ドアオープン検知機能</B></FONT><BR>
ドアをこじ開けられた場合に本警報を行います。</P>
<P><FONT color="#cc00cc" size="4"><B>◆ショックセンサーバイパスモード</B></FONT><BR>
簡単なボタン操作だけで、不正なドア開け、エンジン始動のみを監視。<BR>
立体駐車場や幹線道路沿いなどでも誤作動を無くし、安心してご利用頂けます。</P>
<P><FONT color="#cc00cc" size="4"></FONT><FONT color="#cc00cc"><B>◆　インテリジェントIGプロダクト機能</B></FONT><BR>
従来の警報機はイグニッションがオンになると警報機能が失われましたが、<BR>
本製品はドア開けなどで一度でも警報するとそれ以降はイグニッションを含めた全てのセクターが必ず検知し、車両自体の盗難を防ぎます。</P>
<P><B><FONT color="#cc00cc" size="4">◆エンジンスターター装着車対応。エンジンスターターとの併用が可能です。</FONT></B><BR>
※エンジン作動中に純正キーレスリモコンの操作が出来ない車両では併用出来ません。</P>
<P><FONT color="#cc00cc" size="4"><B>◆動作確認音（チャープ音）</B></FONT><BR>
システムのＯＮ／ＯＦＦ時にチャープ音（アンサーバック音）で動作確認が出来ます。チャープ音を出さない設定も可能です。</P>
<P><FONT color="#cc00cc" size="4"><B>◆車速連動ドアロック機能（選択式）</B></FONT><BR>
CAN-BUS通信を利用し、速度が30km/hに達するとドアを自動的にロックすることが出来ます。ギアが「Ｐ」ポジションになると自動的にアンロックします。</P>
<P>◆ハザードフラッシュ機能<BR>
◆セクターメモリー（過去の警報通知）<BR>
◆強制リセット　（万一、純正キーのリモコン電池切れの場合などでもシステムを強制解除出来ます。）</P>

<P><FONT size="1">VISION　ヴィジョン　カーセキュリティー　盗難警報器　kiramek　キラメック　1480B 1480S</FONT></P><P><FONT size="1">適合車種　トヨタ<BR>
86　IQ　RAV4　SAI　アクア　AQUA　アベンシス　アリオン　アルファード　アルファードハイブリッド　イスト　ウィッシュ　WISH　ヴァンガード　バンガード　ヴェルファイア　ヴェルファイヤ　ヴェルファイヤハイブリッド　ヴィッツ　ヴォクシー　ヴォクシーハイブリッド　VOXY　ボクシー シエンタ　エスクァイア　エスクァイアHV　エスティマ　エスティマハイブリッド　オーリス　カムリ　カローラアクシオ　カローラフィールダー　カローラルミオン　クラウン　クラウンハイブリッド　スぺイド　ノア　ノアハイブリッド　ブレイド　プレミオ　プリウス　プリウスPHV　プリウスα　ベルタ　ポルテ　マークＸ　マークエックスジオ　ラクティス　ランドクルーザー　ランクルプラド☆　ホーネット社製　HORNET 360Vやカーメイト社製　SQ900 　ユピテル社製　Aguilas VE-S500R 等と比べて適合車種のラインナップが豊富です！</FONT></P><style type="text/css">

